import logo from './logo.svg';
import {Link, Outlet} from "react-router-dom";
import Appbar from "./components/Appbar";
import './App.css';

function App() {
  return (
    <div>
    <h1>Bookeeper</h1>
    <Link to="/home">Home</Link>
    <Link to="/careers">Careers</Link>
    <Outlet/>
    </div>
  );
}

export default App;
